import "./App.css";
// import { Layout } from "./component/template/defalute";
import styled from "styled-components";
export default function App() {
  return (
    <Wcontainer>
      <Cheader>
        <div>PHOTO BOOK2</div>
      </Cheader>
    </Wcontainer>
  );
}
const Cheader = styled.header`
  font-size: 32px;
  color: #000000;
  padding: 60px 30px 30px 30px;
`;
const Wcontainer = styled.div`
  width: 1120px;
  padding: 0 10px;
`;
